// export default ProfilePage;
import React, { Component } from 'react';
import '../styles/pages/ProfileStyle.css';

class ProfilePage extends Component {
    constructor(props) {
        super(props);
        this.state = {
            email: 'user@example.com',
            username: 'username',
            profilePicture: 'profile.jpg',
            isEditing: false,
        };
    }

    handleToggleEdit = () => {
        this.setState((prevState) => ({ isEditing: !prevState.isEditing }));
    };

    handleSaveClick = () => {
        // You can add logic here to update the user's profile data in the backend.
        // For simplicity, we'll just update the state.
        this.setState({ isEditing: false });
    };

    handleInputChange = (e) => {
        const { name, value } = e.target;
        this.setState({ [name]: value });
    };

    render() {
        const { email, username, profilePicture, isEditing } = this.state;

        return (
            <div className="profile-container">
                <h1>Profile</h1>
                <div className="profile-picture">
                    <img src={profilePicture} alt="Profile" />
                </div>
                <div className="profile-info">
                    <div>
                        <strong>Email:</strong> {email}
                    </div>
                    <div>
                        <strong>Username:</strong> {username}
                    </div>
                </div>
                <div className="profile-edit">
                    <label>Email:</label>
                    <input
                        type="text"
                        name="email"
                        value={email}
                        onChange={this.handleInputChange}
                        disabled={!isEditing}
                    />
                    <label>Username:</label>
                    <input
                        type="text"
                        name="username"
                        value={username}
                        onChange={this.handleInputChange}
                        disabled={!isEditing}
                    />
                    <label>Profile Picture URL:</label>
                    <input
                        type="text"
                        name="profilePicture"
                        value={profilePicture}
                        onChange={this.handleInputChange}
                        disabled={!isEditing}
                    />
                </div>
                <button
                    onClick={isEditing ? this.handleSaveClick : this.handleToggleEdit}
                    className={`profile-button ${isEditing ? 'active' : 'inactive'}`}
                >
                    {isEditing ? 'Save' : 'Edit'}
                </button>
            </div>
        );
    }
}

export default ProfilePage;
